import React, { Component } from "react";
import "./App.css";
import Button from "@material-ui/core/Button";
import Checkbox from "@material-ui/core/Checkbox";

class PantoneGallery extends Component {
  render() {
    console.log("Gallery props", this.props);
    debugger;
    const { pantones } = this.props;
    return (
      <div>
        <br />
        <br />
        <div className="pantone-item" style="font-size: 24px;">
          <div className="pantone-title">Item</div>
          <div className="pantone-title">Link</div>
          <div className="pantone-title"></div>
        </div>
        {pantones.map((pantone, k) => {
          return (
            <div key={k} className="pantone-item">
              <div className="pantone-title">{pantone.item}</div>
              <div className="pantone-title">
                <Button href={pantone.Link} target="_blank">
                  We like this one
                </Button>
              </div>
              <div className="pantone-title">
                <Checkbox /> purchased
              </div>
            </div>
          );
        })}
      </div>
    );
  }
}

export default PantoneGallery;
